import React from 'react';
import './App.css';

function Home({ userType }) {
  return (
    <div className="login-container">
      <h2>Welcome to Home Page</h2>
      <p>You are logged in as: <strong>{userType}</strong></p>
    </div>
  );
}

export default Home;
